import React from 'react';

//Importando de maneira desestruturada apenas o icones que irá ser utilizado
import { FiLogIn } from 'react-icons/fi';

//Importando o css direto no js, sem necessidade de por no arquivo html
import './styles.css';

//Importando a imagem dentro de uma váriavel
import heroesImg from '../../assets/heroes.png';
import logoImg from '../../assets/logo.svg';

export default function Logon() {
  return (
    //Utilizar {} na tag img para incluir a variável
    <div className="logo-container">
      <section className="form">
        <img src={logoImg} alt="Be The Hero" />

        <form>
          <h1>Faça seu logon</h1>

          <input placeholder="Sua ID"></input>
          <button type="submit">Entrar</button>
          <a href="/register">
            <FiLogIn size={16} color="#E02041" />
            Não tenho cadastro
          </a>
        </form>
      </section>

      <img src={heroesImg} alt="Heroes" />
    </div>
  );
}
